import React from 'react';
import { useNavigate } from 'react-router-dom';
import './card.css';
const prod = [
    {
        id: 1,
        title: "Clothes",
        image: "https://www.rareism.com/cdn/shop/files/ALLEN-OFF-WHITE0589HERO_900x.jpg?v=1691154440",
    },
    {
        id: 2,
        title: "Watches",
        image: "data:image/jpeg;base64,",
    },
    {
        id: 3,
        title: "Bags",
        image:"data:image/jpeg;base64,"
    },
    {
        id: 4,
        title: "Shoes",
        image: "data:image/jpeg;base64,",
    }
];


export default function Product() {
    const nav=useNavigate()
    function goto(id){
        if(id===1)
        {
            console.log(id);
            nav("/Clothes")
        }
        else if(id===2)
        {
            nav("/Watches")
        }
        else if(id===3)
        {
            nav("/Bags")
        }
        else
        {
            nav("/Shoes")
        }
    }
    return (
        <>
            <h2>Product</h2>
            <div className='box-1'>
                {prod.map((item) => (
                    <div className='category' key={item.id}>
                        <h3>{item.title}</h3>
                        <img src={item.image} alt='img'/>
                    <button className="btn1" onClick={()=>goto(item.id)}>Goto</button>
                    </div>
                ))}
            </div>
            
        </>
    );
}
